import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Mula Sem Cabeça'
        },
        {
          name: 'Pé Grande'
        },
        {
          name: 'Abominável Homem das Neves'
        },
        {
          name: 'Zumbi'
        }
      ]
    }
  }

  render() {
    return (
      <div className="App">
       {
         this.state.monsters.map(m => <h1>{m.name}</h1>)
       }
      </div>
    );
  }
}

export default App;
